import React, { Fragment } from 'react'
import './style.scss'

const LikeButton = () => {
    return (
        <Fragment>
            <div>
                <div className="content">
                    <span className="heart"></span>
                </div>
            </div>
        </Fragment>
    )
}

export default LikeButton;
